  \"red-rock-lakes-national-wildlife-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Red Rock
  Lakes NWR outlines Refuge accomplishments during the 1992 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  public participation, and compliance with environmental and cultural resource mandates.
  Refuge administration is outlined; information about personnel, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, grasslands, grazing, fire management, pest control,
  water rights, and wilderness areas. The wildlife section of the report discusses
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, marking and bird banding, and disease
  control. The public uses of the Refuge described in this report include interpretive
  programs, hunting, fishing, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, computer systems, and
  energy conservation. Refuge brochures and field guides are attached.\",\n\t\"license_title\":
